import './App.css';
import info from "./profileinfo";
import Profilepic from "./components/Profilepic"



function profilefunction(detail){
  return(
    <Profilepic 
      id={detail.id}
      key={detail.id}
      name={detail.username}
      email={detail.email}
      img={detail.image}
    />
  );

}

function App() {
  return (
    <div className="App">
    <div className='profile'>
    <div className='profileimg'>
      {info.map(profilefunction)}
    </div>

    </div>
    </div>
  );
}

export default App;
